void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
   vec2 p = (2.*fragCoord.xy-iResolution.xy) / iResolution.y;   
   vec2 q = (2.0*sin(0.4*iTime) - 1.8 ) + exp(p);
   q = fract(q*q.y*(q.x*q.x)) - .5;  
   q.y = fract(2.0*iTime + q.y) - .5;
   float d = length(q) - .4;
   d = smoothstep(.0,.05,-d);
   fragColor = vec4(vec3(.1,.8,.2) * d, 1.0);
}
